$('.button').click(function(){
    $('.img').removeClass('ani');
    $('.button').css('transform','translate(-50%,150%)')
    $('.show').css('display','none');
    $('circle').removeClass('circle');



    let lucky = [];
    for(let i =0;i<allpost.length;i++){
        if(lucky.length<4){
            let a = Math.floor(Math.random()*allpost.length);
            if(!lucky.includes(allpost[a].name)&&allpost[a].post.includes('@')){
                lucky.push(allpost[a].name);
            };
        }
    }

    setTimeout(() => {
        $('.img').addClass('ani');
    },0);
    
    setTimeout(()=>{
        $('.button').css('transform','translate(-50%,600%)')
        $('.show').css('display','inline-block');
        $('.picker1').text(`${lucky[0]} ğŸ±`);
        $('.picker2').text(`${lucky[1]}ğŸ±`);
        $('.picker3').text(`${lucky[2]}ğŸ±`);
        $('.picker4').text(`${lucky[3]}ğŸ±`);
        $('circle').addClass('circle');

    },6000) 
})
